import './Navbar.css';

function Navbar(){
    return(
        <div>
            <nav>
                <ul>
                    <li>Home</li>
                    <li>Contact</li>
                    <li>About</li>
                </ul>
            </nav>
            <button className="btn">btn</button>
        </div>
    )
}
export default Navbar;
